import React from "react";
// import PropTypes from "prop-types";
// import StyledLogo from "./style.js";
import logo from "./citrus-logo.png";

const styles = {
  card: {
    maxWidth: 345
  },
};

function Logo(props) {
  const { classes } = props;
  return <img className={classes.card} src={logo} alt="citrus" />;
}

//  Logo.propTypes = {
//   text: PropTypes.string
//  };

export default Logo;
